tables.table_schema:
CREATE TABLE user_preferences (
    user_id INT PRIMARY KEY,
    preference_1 VARCHAR,
    preference_2 VARCHAR
);

CREATE TABLE behavior_data (
    behavior_id INT PRIMARY KEY,
    user_id INT,
    behavior_info TEXT
);

CREATE TABLE users (id INT PRIMARY KEY,
  name VARCHAR(255),
  email VARCHAR(255),
  age INT
);

CREATE TABLE preferences (user_id INT,
  category VARCHAR(255),
  preference_score INT,
  PRIMARY KEY (user_id, category)
);

CREATE TABLE behavior_data (user_id INT,
  action_type VARCHAR(255),
  action_timestamp TIMESTAMP,
  PRIMARY KEY (user_id, action_timestamp)
);

CREATE TABLE recommendations (user_id INT,
  recommended_item VARCHAR(255),
  recommendation_score INT
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100)
);

CREATE TABLE products (
    product_id INT PRIMARY KEY,
    product_name VARCHAR(100),
    price DECIMAL(10,2)
);
